import React from 'react'
import styled from 'styled-components';

const DayTitle = styled.div`
  display:flex;
  margin: 0 auto;
`;

const DayT = styled.span`
    display:flex;
    justify-content:center;
    width:6rem;
    height:4rem;
    align-items:center;
    font-size:2rem;
    margin:0 auto 2rem;
    background-color:lightgrey;
`;

class DayNames extends React.Component {
    render() {
        return (
          <DayTitle>
            <DayT>Sun</DayT>
            <DayT>Mon</DayT>
            <DayT>Tue</DayT>
            <DayT>Wed</DayT>
            <DayT>Thu</DayT>
            <DayT>Fri</DayT>
            <DayT>Sat</DayT>
          </DayTitle>
        );
    }
}

export default DayNames
